// src/pages/Home.js
import React from 'react';
import '../styles/Home.css';
import { Link } from 'react-router-dom';
import ProfileCard from '../components/ProfileCard';



function Home() {
  return (
    
    <div className="home-container">
      <header className="home-header">
        <h1 className="home-logo">fizz</h1>
        <p className="home-tagline">Let’s Get Matching!</p>
      </header>

      <section className="profile-preview">
        <div className="profile-avatar">
          <img src="https://via.placeholder.com/100" alt="User Avatar" className="avatar-image" />
        </div>
        <div className="profile-info">
          <h2 className="profile-name">Name</h2>
          <p className="profile-age">Age: 25</p>
          <p className="profile-zodiac">Zodiac Sign: Gemini</p>
          <p className="profile-interests">Interests: Hiking, Music, Travel</p>
        </div>
      </section>

      <div className="cta-buttons">
        <Link to="/signup" className="cta-btn signup-btn">Sign Up</Link>
        <Link to="/login" className="cta-btn login-btn">Login</Link>
        <Link to="/match" className="cta-btn match-btn">Let’s Get Match!</Link>
      </div>
    </div>
  );
}

export default Home;
